import React from 'react';
import './searchresults.css';
import SearchBar from './navbar';

const SearchResults = () => {

    return (
    <div>
        <div className='to-hide-from-view'>
            <SearchBar />
        </div>
        <div className='to-show-search-results'>
            <p className='test'>{selectedProducts}</p>
        </div>
    </div>
    )
}

export default SearchResults;
